import React from "react";
import Footer from "../parts/Footer";
import Navbar from "../parts/Navbar";
import Quiz from "../parts/Quiz";

const Blogs = () => {
  return (
    <>
      <Navbar />
      <Quiz />
      <Footer />
    </>
  );
};

export default Blogs;
